import React from "react";
import { Paper, Avatar } from "@mui/material";
import avatar from "./avatar.png";

export default function UserCard({ data }) {
  return (
    <Paper elevation={3}>
      <Avatar
        alt="Remy Sharp"
        src={data.avatarUrl === "" ? avatar : data.avatarUrl}
        sx={{ width: 56, height: 56 }}
      />
    </Paper>
  );
}
